def hello():
    global b1, b2, b3, pic
    name = nameInput.get()
    if name == u'蠢蛋蛋':
        nameInput.destroy()
        var1.set(u'真的是你嘛，%s？' % name)
        var2.set(u'是我呀')
        b1.destroy()
        b1 = Tkinter.Button(app, textvariable=var2,
                            command=she, font=(u'微软雅黑', 12))
        b1.grid(row=2, column=1, sticky="w", pady=10)
    else:
        var1.set(u'不好意思，我找错人了哦')
        var2.set(u'好吧，那就再见咯')
        var3 = Tkinter.StringVar()
        var3.set(u'骗你的啦，我不是%s' % name)
        b1.destroy()
        b2 = Tkinter.Button(app, textvariable=var2,
                            command=quit, font=(u'微软雅黑', 12))
        b3 = Tkinter.Button(app, textvariable=var3,
                            command=rehello, font=(u'微软雅黑', 12))
        b2.grid(row=2, column=1, sticky="w", pady=10)
        b3.grid(row=2, column=2, sticky="w", pady=10)


def main():
    global pic, var1, var2, nameInput, b1, app, l
    app = Tkinter.Tk()
    app.title('Little Cupcake')
    app.geometry('1200x220')
    '''
    In windows, you can put this to change the TK icon.
    img = ''
    tmp = open('tmp.ico', 'wb+')
    tmp.write(base64.b64decode(img))
    tmp.close()
    app.iconbitmap("tmp.ico")
    os.remove("tmp.ico")
    '''
    image = Image.open('cupcake.png')
    photo = ImageTk.PhotoImage(image)
    pic = Tkinter.Label(image=photo)
    pic.grid(row=0, column=0, rowspan=3, padx=40, pady=40)
    var1 = Tkinter.StringVar()
    var1.set('')
    var2 = Tkinter.StringVar()
    var2.set(u'你好！')
    l = Tkinter.Label(app, textvariable=var1, font=(u'微软雅黑', 16))
    l.grid(row=0, column=1, columnspan=3, sticky="w", pady=20)
    var1.set(u'你好哇，你叫什么名字呀？')
    nameInput = Tkinter.Entry()
    nameInput.grid(row=1, column=1, columnspan=3, sticky="w", pady=10)
    b1 = Tkinter.Button(app, textvariable=var2,
                        command=hello, font=(u'微软雅黑', 12))
    b1.grid(row=2, column=1, sticky="w", pady=10)
    app.mainloop()

if __name__ == '__main__':
    main()
